syntax = "proto3";

package tieba;

option java_package = "com.huanchengfly.tieba.post.api.models.protos";

import "GraffitiRankItem.proto";
import "User.proto";

message GraffitiRankListInfo {
  int32 has_more = 1;
  int32 total = 2;
  repeated GraffitiRankItem list = 3;
  int32 show_list_count = 4;
  int32 quick_list_count = 5;
  int32 has_state = 6;
  int64 tid = 7;
  repeated User consent_list = 8;
}
